class ProgramBlock {
	constructor(data) {
		this.course_id = data?.course_id
	}
	static mergeCourses(a, b) {
	}
	static checkCoursesMatch(a, b) {
		return new Promise((resolve, reject) => {
			if(a.course_id !== b.course_id){
				reject("course_id is't match");
			}
			if(a.activities.length !== b.activities.length){
				reject("activities count is't match")
			}
			try {
				for (let i in a.activities) {
					BlockActivity.checkActivityMatch(a.activities[i], b.activities[i])
				}
			}
			catch (er) {
				throw er
			}
			
			resolve()
		})
	}
}
